import React from "react";
import "./courses.scss";
import CourseBox from "./courseBox/courseBox"
import courses from "../../jsonData/courses.json"

const Courses = () => {
  return (
    <section>
      <div>
        <h1>Courses</h1>
        <CourseBox/>
      </div>
    </section>
  );
};

export default Courses;
